    "2016-03-17T20:52:14.433031",nt"name": "iowa-source-water-protection-tracker-and-mapper",nt"isopen":
    false,nt"url": null,nt"notes": "Source Water is a lake, stream, river or
    aquifer where drinking water is obtained.  Source Water Protection (SWP) is the
    act of preventing contaminants from entering public drinking water sources.  SWP
    includes both ground water (wellhead) protection and surface water protection.  The
    Iowa Source Water Protection Tracker houses SWP plans, Phase 1 assessments, groundwater
    investigations, contact information, and other SWP efforts that communities have
    gone through to protect their drinking water.  The Iowa Source Water Protection
    Mapper is designed to show spatially, an online version of the community's Phase
    1 assessment, including an inventory of wells and contaminants. It lists most major
    programs and contaminants, with detailed location information throughout the state
    and links to existing databases.",nt"license_title": "License Not Specified",nt"extras":
